import React, { useState } from "react";
import ReactDOM from "react-dom";

export class MyForm extends React.Component {
  constructor(props) {
    super(props);
    this.state = { username: "" };
  }
  myChangeHandler = (event) => {
    this.setState({ username: event.target.value });
  };
  render() {
    return (
      <>
        <div>
          <p>Consultar Espacios Disponibles</p>
          <Button onClick={clickMe}>Consultar</Button>
        </div>
        <div>
          <p>Consultar Espacios Ocupados</p>
          <Button onClick={clickMe}>Consultar</Button>
        </div>
        <div>
          <p>Reservar Espacio</p>
          <Button onClick={clickMe}>Reservar</Button>
        </div>
        <div>
          <p>Liberar Espacios</p>
          <div>
            <form>
              <h1>Hello {this.state.username}</h1>
              <p>Enter your name:</p>
              <input type="text" onChange={this.myChangeHandler} />
            </form>
          </div>
          <Button onClick={clickMe}>Liberar</Button>
        </div>
      </>
    );
  }
}
export default MyForm;
ReactDOM.render(<MyForm />, document.getElementById("root"));
